import { useNavigate } from "react-router-dom";

const Dashboard = () => {
  const navigate = useNavigate();
  return (
    <div className="section">
          <div>
      <h2>Welcome to [Your Cricket Club Name]</h2>
      <p>
        We are thrilled to welcome you to the official website of [Your Cricket Club Name]! Whether you're a passionate cricket enthusiast, a dedicated player, or just curious about our club, you've come to the right place.
      </p>
      <p>
        At [Your Cricket Club Name], we are not just a team; we are a community of individuals who share a common love for the game of cricket. Our club is built on the principles of sportsmanship, teamwork, and a commitment to excellence both on and off the field.
      </p>
      <p>
        Explore our website to discover the latest news, match updates, player profiles, and exciting events. Whether you're a seasoned player or someone new to the sport, there's a place for everyone in our cricket family. We believe in fostering a welcoming and inclusive environment where every member can thrive and make lasting memories.
      </p>
      <p>
        Join us on this incredible journey as we continue to grow, learn, and celebrate the spirit of cricket together. Feel free to reach out if you have any questions or if you're interested in becoming a part of [Your Cricket Club Name].
      </p>
      <p>
        Thank you for visiting, and we look forward to sharing many exciting moments with you!
      </p>
    </div>
      <button onClick={() => navigate("/")}>Go to Home</button>
    </div>
  );
};

export default Dashboard;


import React from 'react';
